import './Leatic.css';

import { Container } from 'react-bootstrap';

function Leatic(){
    return(
        <div>
            <Container fluid>
                <div className = "leatic">
                    <h3 className = "leatic__uptitle">Home Decor</h3>
                    <h1 className = "leatic__title">Wall Shelf Design</h1>
                    <h3 className = "leatic__text">Top Trending Products</h3>

                    <button className='leatic__button'>Shop Now</button>
                </div>
            </Container>
        </div>
    )
}

export default Leatic;
